import JobItem from '../components/JobItem';
import { useQuery } from 'react-query';
import JobService from '../services/JobService';
import { useParams } from 'react-router-dom';
import axios from "axios";

function JobDetailPage() {
    const {jobId} = useParams();

    console.log(jobId);

    const JOBSEARCH_BASE_URL = "http://localhost:8080/job";

    //const { data: jobData } = useQuery('job', () => JobService.getJobById(jobId));
     //const { data: jobData } = useQuery("asdf", () => { return axios.get("http://localhost:8080/job/get/2");});
    //const { data: jobData } = useQuery('asdf', () => axios.get("http://localhost:8080/job/get/2"));

    let jobData;

    async function getData() {
            jobData = await axios.get(JOBSEARCH_BASE_URL + "/get/" + jobId)
            .then(response => {
                console.log(response)
                return response;
            })
            .catch(error => {
                console.log(error)
            })
    }

    console.log(jobData);

    return <JobItem job={jobData}/>;
}

export default JobDetailPage;
